import React from 'react';
import { LineChart, Line, XAxis, YAxis, Tooltip, CartesianGrid, Legend, ResponsiveContainer } from 'recharts';

const notData = {
    labels: ["M", "T", "W", "T", "F", "S", "S"],
    series: [[12, 17, 7, 17, 23, 18, 38]]
}

const data = [
    {
        "name": "M",
        "Sales": 12
    },
    {
        "name": "T",
        "Sales": 7
    },
    {
        "name": "W",
        "Sales": 32
    },
    {
        "name": "T",
        "Sales": 26
    },
    {
        "name": "F",
        "Sales": 16
    },
    {
        "name": "S",
        "Sales": 8
    },
    {
        "name": "S",
        "Sales": 24
    }
]

export default function LineGraph() {
    return (
        <ResponsiveContainer width="110%" height={200}>
            <LineChart data={data}
                margin={{ top: 5, right: 60, left: -40, bottom: 5 }}>
                <CartesianGrid strokeDasharray="3 3" />
                <XAxis dataKey="name" />
                <YAxis fontSize="10px" />
                <Tooltip />
                <Legend />
                <Line type="monotone" dataKey="Sales" stroke="#ea4845" strokeWidth="3" />
            </LineChart>
        </ResponsiveContainer>
    )
}
